import Head from 'next/head'
import { Component } from 'react'
import {Header} from '@Nav'

class Home extends Component {
  constructor() {
    super()
  }

  render(h) {
    return (
      <div>
        <Head>
          <title>AlApar</title>
        </Head>

      <Header></Header>

      </div>

    );
  }
}

export default Home;
